Information
------------------------------

Million Pound Movers
Behind the scenes of the high-end removals industry in the UK, meeting the wealthy clients moving priceless objects, and the firms tasked with completing the precarious jobs. Art enthusiast Beverly is moving out of her 33-room manor house near Bath, with her collection of antiques needing to be carefully taken with her, while interior designer Yvette is transferring to a rented Chelsea townhouse with the hope of finding love. The Jacobsen family aim to set up a vineyard on an 80-acre countryside estate, and art collector Dora and new husband Nick have a delicate portrait of President Obama to move into their first home together in north-west London.

